let staticData = {
    resetPassword: {
        emailAddress: "Email address",
        resetPasswordButtonLabel: "Reset password",
        header: {
            title: "Forgot your password ?",
            subTitle:
                "Please enter the email address registered on your account."
        }
    },
    spinner: {
        label: "Please wait..."
    },
    notification: {
        internetErrorMessage:
            "Error! Please check your internet and try again.",
        unexpectedErrorMessage:
            "Unknown issue occured, please contact the admin."
    }
};

export { staticData };
